concat( \'{{{\', c7.name, \'}}}->\' ), \'\' ), ifnull( concat( \'{{{\', c6.name, \'}}}->\' ), \'\' ), ifnull( concat( \'{{{\', c5.name, \'}}}->\' ), \'\' ), ifnull( concat( \'{{{\', c4.name, \'}}}->\' ), \'\' ), ifnull( concat( \'{{{\', c3.name, \'}}}->\' ), \'\' ), ifnull( concat( \'{{{\', c2.name, \'}}}->\' ), \'\' ), \'{{{\', c1.name, \'}}}\' ) AS \"Category\" from categories c1 left join categories c2 on c1.parentID = c2.ID left join categories c3 on c2.parentID = c3.ID left join categories c4 on c3.parentID = c4.ID left join categories c5 on c4.parentID = c5.ID left join categories c6 on c5.parentID = c6.ID left join categories c7 on c6.parentID = c7.ID left join categories c8 on c7.parentID = c8.ID ,entities e WHERE e.name = c1.entity order by c1.entity, 2 ',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(6,'classifications','All records',NULL,NULL,'1D',NULL,' select concat( ifnull( concat( \'{{{\', c8.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c7.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c6.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c5.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c4.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c3.name, \'}}}-&gt;\' ), \'\' ), ifnull( concat( \'{{{\', c2.name, \'}}}-&gt;\' ), \'\' ), \'{{{\', cat.name, \'}}}\' ) Category, e.displayName \"Class\", cl.recordID \"___cid\", cl.recordID \"Record;___cid;*;ID\" FROM classifications cl ,categories cat left join categories c2 on cat.parentID = c2.ID left join categories c3 on c2.parentID = c3.ID left join categories c4 on c3.parentID = c4.ID left join categories c5 on c4.parentID = c5.ID left join categories c6 on c5.parentID = c6.ID left join categories c7 on c6.parentID = c7.ID left join categories c8 on c7.parentID = c8.ID, entities e WHERE cl.categoryID = cat.ID AND e.name = SUBSTRING_INDEX( cl.recordID, \'.\', 1 ) ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(7,'categories','Table definition'