LL,NULL,NULL),(20,'user_roles','All records',NULL,NULL,'2D',NULL,'SELECT \n \n \n     CONCAT( u.user_name,\'<input type=\"hidden\" name=\"user__\' ,u.user_name ,\'\" value=\"on\">\'                    ) AS \"User\", \n     r.role_name AS \"Role\", \n     CONCAT( \'<input type=\"checkbox\" name=\"\',r.role_name ,\'___\' ,u.user_name ,\'\"\' ,CASE WHEN ur.role_name IS NULL THEN \'\' ELSE \' checked\' END ,\'>\'                 ) AS \"Perm\" \n FROM roles r INNER JOIN users u ON 1 = 1 \n   LEFT JOIN user_roles ur ON ur.user_name = u.user_name AND ur.role_name = r.role_name \n ORDER BY u.user_name, r.role_name \n \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(21,'entities','Table definition',NULL,NULL,'1D',NULL,'desc entities',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(22,'entities','All records',NULL,NULL,'1D',NULL,' \n SELECT \n     q.ID AS \"___q\", \n     e.name AS \"Name\", \n     \'<link table=\"_system_\" queryName=\"Column List\" columns=\"_tq_,table\" using=\"___q,___n\" />\' AS \";Name\", \n     e.name AS \"___n\", \n     \'displayName\' AS \"___p\", \n     e.displayName AS \"___d\", \n     e.displayName AS \"Display name\", \n     \'<link using=\"___n,___p,___d\" table=\"localizedMessages\" columns=\"entity,topic,messageKey\" />\' AS \";Display name\", \n     <unless parameter=\"origin\"> e.origin AS \"Origin\", </unless> \n     CONCAT( \'entities.\',e.name                      ) AS \"___eid\", \n     CASE WHEN i.ID IS NULL THEN \'Click\' \n     ELSE \n        CONCAT( \'<img src=\"viewBlob?_t_=icons&_typeColumn_=mimeType&_dataColumn_=data&ID=\',\n             CAST(i.ID AS CHAR) ,\'\" />\'                    ) \n      END \n         AS \"Icon\", \n     \'<link using=\"___eid\" table=\"icons\" columns=\"ownerID\"/>\' AS \";Icon\", \n     e.type AS \"Type\", \n     e.primaryKeyColumn AS \"Primary key\", \n  \n     COUNT( DISTINCT qq.ID ) AS \"Views\", \n     \'<link using=\"___n\" table=\"queries\" columns=\"table_name\"/>\' \n        AS \";Views\", \n  \n     \'<sql>SELECT name FROM queries WHERE table_name = \'<var:___n />\'</sql>\' \n        AS \"View List\", \n     \'<quick visible=\"false\"/>\' \n        AS \";View List\", \n  \n     COUNT( DISTINCT o.ID ) AS \"Operations\", \n     \'<link using=\"___n\" table=\"operations\" columns=\"table_name\" />\' AS \";Operations\", \n  \n     \'<sql>SELECT name FROM operations WHERE table_name = \'<var:___n />\'</sql>\' \n        AS \"Operation List\", \n     \'<quick visible=\"false\"/>\' \n        AS \";Operation List\" \n  \n \n  \n FROM entities e \n  \n \n        LEFT JOIN icons i ON i.ownerID = CONCAT( \'entities.\',e.name                      ) \n        LEFT JOIN queries qq ON e.name = qq.table_name \n        LEFT JOIN operations o ON e.name = o.table_name \n        LEFT JOIN queries q ON q.name = \'Table definition\' AND q.table_name = e.name \n \n GROUP BY q.ID, e.name, e.displayName, e.type, e.primaryKeyColumn, e.origin, i.ID \n ORDER BY e.name \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(23,'entities','*** Selection view ***',NULL,NULL,'1D',NULL,'SELECT name AS \"Code\", displayName AS \"Name\" FROM entities',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(24,'entities','Quick Filter: Browse by origin origin entities',NULL,NULL,'1D_unknown',NULL,'SELECT DISTINCT origin FROM entities',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(25,'contexts','Table definition',NULL,NULL,'1D',NULL,'desc contexts',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(26,'contexts','All records',NULL,NULL,'1D',NULL,' ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(27,'contexts','*** Selection view ***',NULL,NULL,'1D',NULL,'SELECT ID AS \"Code\", name AS \"Name\" FROM contexts',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(28,'queries','Table definition',NULL,NULL,'1D',NULL,'desc queries',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(29,'queries','All records',NULL,NULL,'1D',NULL,'SELECT \n         \'viewName\' AS \"___viewname\", \n         q.table_name AS \"___tname\", \n         q.name AS \"___name\", \n         q.name AS \"Name\", \n         \'___tname,___viewname,___name;localizedMessages;entity,topic,messageKey\' AS \";Name\", \n         q.type AS \"Type\", \n         CONCAT( \'<a href=\"viewText?_t_=queries&_typeColumn_=\'\'text/plain\'\'&_dataColumn_=query&ID=\',CAST(q.ID AS CHAR) ,\'\">{{{Click}}}</a>\'                     ) \n           AS \"Code\", \n         q.ID AS \"___qid\", \n         qv.ID AS \"___vid\", \n         COUNT( DISTINCT qs.ID ) AS \"Settings\", \n         \'___qid;querySettings;queryID\' AS \";Settings\", \n         COUNT( DISTINCT opq.operID ) AS \"Usage with operations\", \n         \'___qid;operations_per_query;queryID\' AS \";Usage with operations\", \n         COUNT( DISTINCT qpr.role_name ) AS \"Access\", \n         \'___vid,___qid;queries_per_role;_q_,queryID\' AS \";Access\", \n         MAX( \'Columns\' ) AS \"Localizations\", \n         \'___tname,___name;localizedMessages;entity,topic\' AS \";Localizations\" \n  \n \n  \n FROM queries q \n        LEFT JOIN queries_per_role qpr ON qpr.queryID = q.ID \n        LEFT JOIN operations_per_query opq ON opq.queryID = q.ID \n        LEFT JOIN querySettings qs ON qs.queryID = q.ID \n    , queries qv \n WHERE qv.table_name = \'queries_per_role\' AND qv.name = \'Role list\' \n GROUP BY q.table_name, q.name, q.type, q.ID, qv.ID \n ORDER BY q.name',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(30,'queries','*** Selection view ***',NULL,NULL,'1D',NULL,'SELECT \n     q.ID AS \"code\", CONCAT( e.displayName,\': \' ,q.name                     ) AS \"name\" \n FROM queries q, entities e \n WHERE q.table_name = e.name \n ORDER BY q.table_name, q.name',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(31,'operations','Table definition',NULL,NULL,'1D',NULL,'desc operations',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(32,'operations','All records',NULL,NULL,'1D',NULL,'SELECT \n         \'operationName\' AS \"___opername\", \n         o.table_name AS \"___tname\", \n         o.name AS \"___name\", \n         o.name AS \"Name\", \n         \'___tname,___opername,___name;localizedMessages;entity,topic,messageKey\' AS \";Name\", \n         o.type \"Type\", \n         o.code \"Code\", \n         o.ID \"___oid\", \n         qv.ID \"___vid\", \n         COUNT( DISTINCT opq.queryID ) AS \"Usage in queries\", \n         \'___oid;operations_per_query;operID\' AS \";Usage in queries\", \n         COUNT( DISTINCT opr.role_name ) AS \"Access\", \n         \'___vid,___oid;operations_per_role;_q_,operID\' AS \";Access\", \n         MAX( \'Input fields\' ) AS \"Localizations\", \n         \'___tname,___name;localizedMessages;entity,topic\' AS \";Localizations\", \n         MAX( \'Click\' ) AS \"Logs\", \n         \'___tname,___name;operationLogs;table_name,operation_name\' AS \";Logs\" \n  \n \n  \n FROM operations o \n       LEFT JOIN operations_per_role opr ON opr.operID = o.ID \n       LEFT JOIN operations_per_query opq ON opq.operID = o.ID \n    , queries qv \n WHERE qv.table_name = \'operations_per_role\' AND qv.name = \'Role list\' \n GROUP BY o.table_name, o.name, o.type, o.code, o.ID, qv.ID \n ORDER BY o.name',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(33,'operations','*** Selection view ***',NULL,NULL,'1D',NULL,'SELECT \n    o.ID AS \"Code\", CONCAT( e.displayName,\'::\' ,o.name                     ) AS \"Name\" \n FROM operations o, entities e \n WHERE o.table_name = e.name \n ORDER BY e.displayName, o.name',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(34,'queries_per_role','Table definition',NULL,NULL,'1D',NULL,'desc queries_per_role',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(35,'queries_per_user','Table definition',NULL,NULL,'1D',NULL,'desc queries_per_user',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(36,'operations_per_role','Table definition',NULL,NULL,'1D',NULL,'desc operations_per_role',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(37,'operations_per_user','Table definition',NULL,NULL,'1D',NULL,'desc operations_per_user',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(38,'operations_per_query','Table definition',NULL,NULL,'1D',NULL,'desc operations_per_query',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(39,'queries_per_role','All records',NULL,NULL,'2D',NULL,'SELECT \n \n \n     CONCAT( \'{{{\',q.table_name ,\'}}}-&gt;{{{\' ,q.name ,\'}}}<input type=\"hidden\" name=\"query__\' ,CAST(q.ID AS CHAR) ,\'\" value=\"on\">\'                 ) AS \"Query\", \n     r.role_name AS \"Role\", \n     CONCAT( \'<input type=\"checkbox\" name=\"\',r.role_name ,\'___\' ,CAST(q.ID AS CHAR) ,\'\"\' ,CASE WHEN qpr.role_name IS NULL THEN \'\' ELSE \' checked\' END ,\'>\'                 ) AS \"Access\" \n FROM queries q \n   INNER JOIN roles r ON r.role_name = r.role_name \n      LEFT JOIN queries_per_role qpr ON qpr.queryID = q.ID AND qpr.role_name = r.role_name \n ORDER BY q.table_name, q.name, r.role_name \n \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(40,'queries_per_role','Role list',NULL,NULL,'1D',NULL,'SELECT \n     q.name AS \"Query\", \n     qpr.role_name AS \"Role\" \n FROM queries_per_role qpr, queries q \n WHERE qpr.queryID = q.ID \n ORDER BY qpr.role_name \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(41,'operations_per_role','All records',NULL,NULL,'2D',NULL,'SELECT \n \n \n     CONCAT( \'{{{\',o.table_name ,\'}}}::{{{\' ,o.name ,\'}}}<input type=\"hidden\" name=\"operation__\' ,CAST(o.ID AS CHAR) ,\'\" value=\"on\">\'                 ) AS \"Operation\", \n     r.role_name AS \"Role\", \n     CONCAT( \'<input type=\"checkbox\" name=\"\',r.role_name ,\'___\' ,CAST(o.ID AS CHAR) ,\'\"\' ,CASE WHEN opr.role_name IS NULL THEN \'\' ELSE \' checked\' END ,\'>\'                 ) AS \"Access\" \n FROM operations o \n   INNER JOIN roles r ON r.role_name = r.role_name \n      LEFT JOIN operations_per_role opr ON opr.operID = o.ID AND opr.role_name = r.role_name \n ORDER BY o.table_name, o.name, r.role_name \n \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(42,'operations_per_role','Role list',NULL,NULL,'1D',NULL,'SELECT \n     o.name AS \"Operation\", \n     opr.role_name AS \"Role\" \n FROM operations_per_role opr, operations o \n WHERE opr.operID = o.ID \n ORDER BY opr.role_name \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(43,'operations_per_query','All records',NULL,NULL,'1D',NULL,'SELECT \n     q.ID AS \"___qid\", \n     q.name AS \"Query;___qid;queries;ID\", \n     o.ID AS \"___oid\", \n     o.name AS \"Operation;___oid;operations;ID\" \n FROM operations_per_query opq, operations o, queries q \n WHERE opq.operID = o.ID AND opq.queryID = q.ID \n ORDER BY q.name \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(44,'colorSchemes','Table definition',NULL,NULL,'1D',NULL,'desc colorSchemes',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(45,'colorSchemes','All records',NULL,NULL,'1D',NULL,'SELECT \n         cs.name \n            AS \"Name\", \n         CASE WHEN \n COALESCE( up.pref_value,\'1\'        ) \n \n          = CAST(cs.ID AS CHAR) THEN \'Yes\' ELSE \'&nbsp;\' END \n            AS \"Default\", \n         CONCAT( \'<table border=1 cellpadding=5><tr>\',\n           \'<td align=\"center\" width=30 bgcolor=\"#\' ,cs.indexBackground ,\'\"><font color=\"#\' ,cs.indexText ,\'\">M<br />E<br />N<br />U</font></td>\'                  ) \n             \"Tables - Preview;<nosort/>\", \n  \n         CONCAT( \'<td width=120 bgcolor=\"#\',cs.queryBackground ,\'\"><table width=\"100%\" border=1 cellpadding=3 cellspacing=0 bordercolor=\"#\' ,\n             cs.tableBorders ,\'\"><tr><td bgcolor=\"#\' ,cs.tableBorders ,\'\"><font color=\"#\' ,cs.headerLink ,\n        