erationQueueServers',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(116,'operationQueueServers','*** Selection view ***',NULL,NULL,'1D',NULL,'SELECT ID AS \"Code\", address AS \"Name\" FROM operationQueueServers',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(117,'operationQueue','Table definition',NULL,NULL,'1D',NULL,'desc operationQueue',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(118,'operationQueue','All records',NULL,NULL,'1D',NULL,' \n SELECT \n   q.ID AS \"___ID\", \n <unless parameter=\"user_name\"> \n   ol.user_name \n     AS \"User name\", \n </unless> \n   q.status \n     AS \"Status\", \n <if parameter=\"groupOwnerOperLogID\"> \n   q.`___orderFor_operationLogs` \n     AS \"Order\", \n  \n   \'<edit column=\"___orderFor_operationLogs\" size=\"2\" />\' \n     AS \";Order\", \n  \n   CASE WHEN q.groupDependsOnOperLogID IS NOT NULL THEN \'&nbsp;&nbsp;\\_\' \n   ELSE \' \' \n   END \n </if> \n <unless parameter=\"groupOwnerOperLogID\"> \n   CASE WHEN q.groupDependsOnOperLogID IS NOT NULL THEN \'&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\\_\' \n        WHEN owner.ID IS NOT NULL THEN \'&nbsp;&nbsp;\\_\' \n   ELSE CASE WHEN q.startDate IS NOT NULL THEN CONCAT( CHAR(91),\'{{{\' ,DATE_FORMAT(q.startDate,\'%Y-%m-%d %H:%i:%S\') ,\'}}}\' ,CHAR(93) ,\' \'                  ) ELSE \' \' END \n   END \n </unless> \n     AS \"Description\", \n  \n   COALESCE( q.description,CONCAT( \'{{{\',o.table_name ,\'}}}::{{{\' ,o.name ,\'}}}\'                   )        ) \n     AS \"+Description\", \n   CASE WHEN q.isGroupOwner = \'yes\' THEN CONCAT( \' - \',CHAR(91) ,\'{{{\' ,q.groupAction ,\'}}}\' ,CHAR(93)                  ) ELSE \' \' END \n     AS \"+Description\", \n   CASE WHEN serv.ID IS NOT NULL THEN CONCAT( \' \',CHAR(91) ,serv.address ,CHAR(93)                    ) ELSE \' \' END \n     AS \"+Description\", \n   CASE WHEN q.isGroupOwner = \'yes\' THEN \n  \n      CONCAT( \'<link using=\"\',CAST(q.operLogID AS CHAR) ,\'\" table=\"operationQueue\" columns=\"groupOwnerOperLogID\" />\'                     ) \n   ELSE \' \' END \n     AS \";Description\", \n  \n /* \n   o.table_name \n     AS \"Entity\", \n   o.name \n     AS \"Name\", \n */ \n  \n   CASE \n      WHEN q.isGroupOwner = \'yes\' AND q.status = \'pending\' THEN \'groupOwnerScheduled\' \n      WHEN q.isGroupOwner = \'yes\' AND q.status = \'error\' THEN \'groupOwnerError\' \n      WHEN q.isGroupOwner = \'yes\' AND q.status = \'in progress\' THEN \'groupOwnerRunning\' \n      WHEN q.isGroupOwner = \'yes\' THEN \'groupOwner\' \n      WHEN q.isGroupOwner = \'yes\' AND q.status = \'in progress\' THEN \'groupOwnerRunning\' \n \n      WHEN q.status = \'in progress\' AND EXISTS( SELECT dl.ID FROM daemonLogs dl WHERE dl.operLogID = q.operLogID AND dl.daemonName = \'Worker Offline Execute Daemon\' ) THEN \'worker\' \n \n      WHEN q.status = \'pending\' THEN \'toBeScheduled\' \n      WHEN q.status = \'error\' THEN \'errorStatus\' \n      WHEN q.status = \'in progress\' THEN \'runningStatus\' \n   ELSE NULL \n   END \n      AS \"___css_class\", \n  \n   ol.ID \n     AS \"___olid\", \n   \'<sql limit=\"10\" beautifier=\"com.beanexplorer.web.html.HtmlLineGlueBeautifier\">SELECT CONCAT( paramName,\'=\' ,paramValue                     ) \n FROM operationLogParams \n WHERE paramName NOT IN ( \'_q_\', \'_t_\', \'_qn_\', \'user-breadcrumbs\' ) AND SUBSTRING(paramName,1,5 ) NOT IN ( \'_rec_\') AND operLogID = <var:___olid /> ORDER BY ID \n </sql>\' \n     AS \"Parameters\", \n   \'<link using=\"___olid\" table=\"operationLogParams\" columns=\"operLogID\" />;<nosort />;<quick visible=\"true\" />\' \n     AS \";Parameters\", \n  \n    q.`___execStart` AS \"Started;<blankNulls />\", \n    q.`___execEnd` AS \"Ended;<blankNulls />\", \n  \n   \'<sql limit=\"1\">SELECT CONCAT( DATE_FORMAT(dl.occuredAt ,\'%Y-%m-%d %H:%i:%S\'),\': \' ,dl.message                     ) AS \"Last\" \n FROM daemonLogs dl \n WHERE dl.daemonName IN ( \'Offline Execute Daemon\', \'Worker Offline Execute Daemon\' ) AND dl.operLogID = <var:___olid/> \n ORDER BY dl.occuredAt DESC, dl.ID DESC \n </sql>\' \n     AS \"Journal\", \n   \'<link using=\"___olid\" table=\"daemonLogs\" columns=\"operLogID\" />;<nosort />\' \n     AS \";Journal\" \n  \n FROM operationQueue q \n        LEFT JOIN operationQueueServers serv ON q.serverID = serv.ID \n        LEFT JOIN operationLogs owner ON q.groupOwnerOperLogID = owner.ID \n           LEFT JOIN operationQueue owner_q ON owner_q.operLogID = owner.ID \n        LEFT JOIN operationLogs dep ON q.groupDependsOnOperLogID = dep.ID \n           LEFT JOIN operationQueue dep_q ON dep_q.operLogID = dep.ID \n         LEFT JOIN operationQueue dep1 ON dep1.groupDependsOnOperLogID = q.operLogID \n         LEFT JOIN operationQueue dep2 ON dep2.groupDependsOnOperLogID = dep1.operLogID \n         LEFT JOIN operationQueue dep3 ON dep3.groupDependsOnOperLogID = dep2.operLogID \n         LEFT JOIN operationQueue dep4 ON dep4.groupDependsOnOperLogID = dep3.operLogID \n         LEFT JOIN \n         ( \n           SELECT  oq.ID AS ID, \n               MIN( CASE \n                   WHEN oq.status IN ( \'in progress\', \'locked\' ) THEN 0 \n                   WHEN children.status IN ( \'in progress\', \'locked\' ) THEN 0 \n                   WHEN parent.status IN ( \'in progress\', \'locked\' ) THEN 0 \n                   WHEN sibling.status IN ( \'in progress\', \'locked\' ) THEN 0 \n              ELSE 1 \n              END) \n                 AS remoteFinished \n           FROM operationQueue oq \n  \n              LEFT JOIN operationQueue children ON oq.operLogID = children.groupOwnerOperLogID \n              LEFT JOIN operationQueue parent ON parent.operLogID = oq.groupOwnerOperLogID \n              LEFT JOIN operationQueue sibling ON sibling.groupOwnerOperLogID = oq.groupOwnerOperLogID \n           GROUP BY oq.ID \n      ) oq ON oq.ID = q.ID \n      ,operationLogs ol, operations o \n WHERE q.operLogID = ol.ID AND ol.table_name = o.table_name AND ol.operation_name = o.name  \n <if parameter=\"status\"> \n    AND ( q.status IN <parameter:status multiple=\"true\" /> OR \n          owner_q.status IN <parameter:status multiple=\"true\" /> OR \n          EXISTS( SELECT scheck.ID FROM operationQueue scheck \n                  WHERE scheck.groupOwnerOperLogID IN ( q.operLogID, q.groupOwnerOperLogID ) \n                      AND scheck.status IN <parameter:status multiple=\"true\" /> \n                ) \n        ) \n </if> \n <if parameter=\"user_name\"> \n    AND ol.user_name = \'<parameter:user_name/>\' \n </if> \n ORDER BY \n          oq.remoteFinished, \n          COALESCE( owner_q.`___order`,q.`___order`       ), \n          COALESCE( owner_q.creationDate___,q.creationDate___       ) DESC, \n          COALESCE( owner_q.ID,q.ID       ), \n          CASE WHEN owner_q.ID IS NULL THEN 1 ELSE 2 END, \n          COALESCE( dep4.operLogID,COALESCE( dep3.operLogID,COALESCE( dep2.operLogID,COALESCE( dep1.operLogID,CASE WHEN q.groupDependsOnOperLogID IS NOT NULL THEN q.operLogId END       )       )       )       ), \n          CASE WHEN owner_q.ID IS NOT NULL THEN q.`___orderFor_operationLogs` ELSE 99999 END, \n          q.creationDate___ \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,'Operation queue is empty.'),(119,'operationQueue','Quick Filter: Browse by status status operationQueue',NULL,NULL,'1D_unknown',NULL,'SELECT DISTINCT status FROM operationQueue q, operationLogs ol \n WHERE q.operLogID = ol.ID \n <if parameter=\"user_name\"> \n    AND ol.user_name = \'<parameter:user_name/>\' \n </if> \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(120,'operationLogs','Operations in the queue',NULL,NULL,'1D',NULL,' \n SELECT \n    ol.ID AS \"CODE\", \n    CASE WHEN q.description IS NULL THEN \n        CONCAT( \'{{{\',o.table_name ,\'}}}::{{{\' ,o.name ,\'}}} {{{created by}}} \' ,q.whoInserted___ ,\' {{{at}}} {{{\' ,DATE_FORMAT(q.creationDate___,\'%Y-%m-%d %H:%i:%S\') ,\'}}}\'               ) \n    ELSE \n        CONCAT( q.description,\' {{{created by}}} \' ,q.whoInserted___ ,\' {{{at}}} {{{\' ,DATE_FORMAT(q.creationDate___,\'%Y-%m-%d %H:%i:%S\') ,\'}}}\'                  ) \n    END \n        AS \"NAME\", \n    CASE WHEN q.isGroupOwner = \'yes\' THEN \'font-weight: bold\' ELSE NULL END \n        AS \"___css_style\" \n <if parameter=\"q.isGroupOwner\"> \n    ,q.ID AS \"queueID\" \n </if> \n FROM operationQueue q, operationLogs ol, operations o \n WHERE q.operLogID = ol.ID AND ol.table_name = o.table_name AND ol.operation_name = o.name \n <if parameter=\"groupLeaders\"> \n      AND q.isGroupOwner = \'yes\' AND q.status = \'pending\' \n </if> \n <if parameter=\"sameOwner\"> \n      AND q.groupOwnerOperLogID = <parameter:sameOwner /> \n      AND NOT EXISTS (SELECT ID FROM operationQueue WHERE groupOwnerOperLogID = <parameter:sameOwner /> AND q.operLogID = groupDependsOnOperLogID AND ID != <parameter:notQueueID /> ) \n </if> \n <if parameter=\"notQueueID\"> \n      AND q.ID != <parameter:notQueueID /> \n </if> \n ',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(121,'users','Operation queue',NULL,NULL,'static',NULL,'operationQueue.redir?user_name=@@username@@&status=pending&status=scheduled&status=in+progress&status=template',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(122,'operationQueue','Messages for the queue',NULL,NULL,'1D',NULL,' \n SELECT \n    CONCAT( \'*\',oq.status ,\'*\'                     ) AS \"remoteStatus\", \n    \'<sql>SELECT \n     MIN( CASE \n         WHEN oq.status IN ( \'in progress\', \'scheduled\', \'locked\' ) THEN 0 \n         WHEN children.status IN ( \'in progress\', \'scheduled\', \'locked\' ) THEN 0 \n    ELSE 1 \n    END) \n       AS \"remoteFinished\" \n FROM operationQueue oq \n  \n    LEFT JOIN operationQueue children ON oq.operLogID = children.groupOwnerOperLogID \n WHERE oq.ID = <parameter:ID /></sql>\' \n       AS \"remoteFinished\", \n    dl.occuredAt AS \"remoteWhen\", \n    dl.message AS \"remoteMessage\" \n FROM operationQueue oq \n    LEFT JOIN operationQueue children ON oq.operLogID = children.groupOwnerOperLogID \n    LEFT JOIN daemonLogs dl ON dl.operLogID IN ( oq.operLogID, children.operLogID ) \n WHERE 1 = 1 \n <if parameter=\"ID\" /> AND oq.ID = <parameter:ID /> </if> \n ORDER BY dl.occuredAt \n ',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(123,'_logout_','<!--99-->Logout',NULL,NULL,'static',NULL,'logout',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(124,'users','Login',NULL,NULL,'static',NULL,'login',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(125,'users','Forgot Password?',NULL,NULL,'1D',NULL,' ',NULL,'no','no','no','no','no',NULL,277,NULL,NULL,NULL,NULL),(126,'groups','All records',NULL,NULL,'1D',NULL,' \n   SELECT  \n g.ID AS \"___id\", \n g.name AS \"Group\", \n \'<truncate length=\"25\"/>;<link using=\"___id\" table=\"user_groups\" columns=\"groupID\"/>\' AS \";Group\",  \n g.language AS \"Language\", \n       g.description AS \"Description\", \n       \'<sql> \n         SELECT CONCAT(ug.user, \' (\', ug.role,\')\') \n         FROM user_groups ug \n         WHERE ug.groupID = <var:___ID/> \n       </sql>\' AS \"Users\", \n       \'<sql> \n         SELECT CONCAT(gp.module, \' (\', gp.permission,\')\') \n         FROM group_permissions gp \n         WHERE gp.groupID = <var:___ID/> \n       </sql>\' AS \"Protected databases\" \n FROM groups g ORDER BY g.name \n ',NULL,'no','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(127,'user_groups','All records',NULL,NULL,'1D',NULL,' \n   SELECT  \n ug.ID AS \"___id\", \n g.name AS \"Group\",  \n ug.user AS \"Name\",  \n ug.role AS \"Role\" \n FROM user_groups ug LEFT JOIN groups g ON g.ID=ug.groupID \n ',NULL,'yes','no','no','no','no',NULL,NULL,NULL,NULL,NULL,NULL),(128,'groups','My groups',NULL,NULL,'1D',NULL,' \n   SELECT  \n g.ID AS \"___id\", \n g.name AS \"Group\", \n g.language AS \"Language\", \n ug.role AS \"Role\", \n    